$(document).ready(function(){$('a[href*="#"]:not([href="#"]):not([href="#release-notes"])').click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var a=$(this.hash);a=a.length?a:$("[name="+this.hash.slice(1)+"]");if(a.length){$("html, body").animate({scrollTop:a.offset().top},1000);return false}}});$.ajax({type:"GET",url:"https://api.github.com/repos/AntumDeluge/debreate",dataType:"json",success:function(a){$("#github-stars").append(a.stargazers_count);$("#github-forks").append(a.forks)}});$.ajax({type:"GET",url:"https://api.github.com/repos/AntumDeluge/debreate/contributors",dataType:"json",success:function(a){$.each(a,function(b,c){$("#contributors-list").append('<div class="contributor card"><img src="'+a[b].avatar_url+'"><p><a href="'+a[b].html_url+'" class="contributor-login">'+a[b].login+"</a><br>"+a[b].contributions+" contribution"+((a[b].contributions>1)?"s":"")+"</p></div>")})}});$("#faqs dd").hide();$("#faqs dt").click(function(){$(this).next("#faqs dd").slideToggle(500);$(this).toggleClass("expanded")})});